import { memo } from 'react'
import Select from 'react-select';
import makeAnimated from 'react-select/animated';
import { AiOutlineWifi, AiOutlineCar } from 'react-icons/ai'
import { GiDamagedHouse, GiShoppingCart } from 'react-icons/gi'
import { MdOutlineSportsEsports, MdOutlineBusinessCenter } from 'react-icons/md'
import Bell from '../../images/hotel-bell.png';
import Spa from '../../images/spa.png'
import Restaurant from '../../images/restaurant.png'
import PlayTime from '../../images/playtime.png'
import { englishUtilitiesAndServicesPlaceholder, englishUtilitiesAndServicesDetail, vietnameseUtilitiesAndServicesPlaceholder, vietnameseUtilitiesAndServicesDetail } from '../../Languages/UtilitiesAndServices';

import './RegisterUtilitiesAndServices.scss'

function RegisterUtilitiesAndServices({ languageSelected }) {
    const animatedComponents = makeAnimated();

    let languageListUtilitiesAndServicesDetail = (languageSelected === 'EN' ? englishUtilitiesAndServicesDetail : vietnameseUtilitiesAndServicesDetail)
    let languageListUtilitiesAndServicesPlaceholder = (languageSelected === 'EN' ? englishUtilitiesAndServicesPlaceholder : vietnameseUtilitiesAndServicesPlaceholder)

    return (
        <div className='container'>
            <div className='space-30 background-w'>
                <div className="d-flex line-input line-input-3-line align-up">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <AiOutlineWifi className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[0]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[0]}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <GiDamagedHouse className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[1]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[1]}
                        />
                    </div>
                </div>
                <div className="d-flex line-input line-input-3-line align-up">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <img src={Bell} className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[2]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[2]}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <img src={Spa} className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[3]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[3]}
                        />
                    </div>
                </div><div className="d-flex line-input line-input-3-line align-up">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <img src={Restaurant} className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[4]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[4]}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <MdOutlineSportsEsports className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[5]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[5]}
                        />
                    </div>
                </div><div className="d-flex line-input line-input-3-line align-up">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <img src={PlayTime} className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[6]}
                        </label>
                        <Select className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[6]}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <GiShoppingCart className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[7]}
                        </label>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[7]}
                        />
                    </div>
                </div><div className="d-flex line-input line-input-3-line align-up">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <MdOutlineBusinessCenter className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[8]}
                        </label>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[8]}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'>
                            <AiOutlineCar className='icon-image icon-select' />{languageListUtilitiesAndServicesPlaceholder[9]}
                        </label>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={languageListUtilitiesAndServicesDetail[9]}
                        />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default memo(RegisterUtilitiesAndServices)
